//Router
import { BrowserRouter, Routes, Route } from "react-router-dom";

// Styles
import "./style.scss";

//Views
import Landing from "./views/Landing";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Landing />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
